import React from 'react';
import { Typography } from '@mui/material';

function Dashboard() {
  return (
    <div>
      <Typography variant="h4">Dashboard</Typography>
      <Typography variant="body1">Welcome to the Dashboard!</Typography>
    </div>
  );
}

export default Dashboard;
